import './chatPage.css'

const ChatPage = () => {
    return (
        <div className="container">
            <div className='list'>
                <div className='userInfo'>
                    <h2>Name</h2>
                </div>
            </div>
            <div className='chat'>Chat</div>
        </div>
    )
}

export {ChatPage}
